package compressor

import (
	"bytes"
	"compress/gzip"
	"fmt"
	"io"
	"os"
)

const Base64Str = `data:image/png;base64,`

func panicError(err error) {
	if err != nil {
		panic(err)
	}
}

func CompressText() {
	var buf bytes.Buffer

	gzpWriter := gzip.NewWriter(&buf)

	_, err := gzpWriter.Write([]byte(Base64Str))
	panicError(err)

	err = gzpWriter.Close()
	panicError(err)

	fmt.Printf("Original string length: %d\n", len(Base64Str))
	fmt.Printf("Compressed data length: %d\n", buf.Len())

	err = os.WriteFile("assets/test.txt", buf.Bytes(), 0644)
	panicError(err)
}

func DecompressText(filename string) {
	file, err := os.OpenFile(filename, os.O_RDONLY, 0644)
	panicError(err)
	defer file.Close()

	var buf bytes.Buffer
	gzpReader, err := gzip.NewReader(file)
	panicError(err)
	_, err = buf.ReadFrom(gzpReader)
	panicError(err)
	err = gzpReader.Close()
	panicError(err)
	data := buf.String()
	println("Decompressed length", len(data))
	fmt.Println(data)

	file.Seek(0, 0)
	ut, err := io.ReadAll(file)
	panicError(err)
	println("Compressed length", len(ut))
}

func DoUndoCOmpress(text string) {
	var buf bytes.Buffer

	// Compress the string
	gzpWriter := gzip.NewWriter(&buf)
	_, err := gzpWriter.Write([]byte(text))
	panicError(err)

	err = gzpWriter.Close()
	panicError(err)

	fmt.Printf("Original string length: %d\n", len(text))
	fmt.Printf("Compressed data length: %d\n", buf.Len())

	// Decompress by gzip reader
	gzpReader, err := gzip.NewReader(bytes.NewReader(buf.Bytes()))
	panicError(err)

	data, err := io.ReadAll(gzpReader)
	panicError(err)
	err = gzpReader.Close()
	panicError(err)
	println("Decompressed length", len(data))
}
